import React from 'react';

//import {makeStyles} from '@material-ui/core/styles'
import AppBar from '@material-ui/core/AppBar';
import Box from '@material-ui/core/Box';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';

import LocalGroceryStoreIcon from '@mui/icons-material/LocalGroceryStore';

import {makeStyles} from "@material-ui/core";

import EmployeeRegistrationForm from './createEmployee/EmployeeRegistrationForm'


const useStyles = makeStyles((theme)=>({
    root: {
        flexGrow: 1,
    },

    menuButton: {
        marginRight: theme.spacing(2),
    },

    title: {
        flexGrow: 1,
    },

}));

export default function ButtonAppBar() {
    const classes = useStyles();
    return (
        <Box sx={{ flexGrow: 0 }}>
            <AppBar position="static">
                <Toolbar>
                    <IconButton
                        className={classes.menuButton}
                        size="large"
                        edge="start"
                        color="inherit"
                        aria-label="menu"
                        sx={{ mr: 2 }}
                    >
                        <LocalGroceryStoreIcon />
                    </IconButton>
                    <Typography variant="h6" className={classes.title} component="div" sx={{ flexGrow: 1 }}>
                        Stack Management System
                    </Typography>

                    <Button color="inherit">Sign in</Button>
                    <Button color="inherit" onClick={ <EmployeeRegistrationForm/>} >Register Employee</Button>
                </Toolbar>
            </AppBar>
        </Box>
    );
}
